  false,\n\t\"url\": null,\n\t\"notes\": \"The lower stretches of the Yellow River
  support some of Wisconsin's most diverse communities. The unique character of this
  community is evidenced by the number of species using the riverway that are currently
  listed or being considered for listing as federally endangered or threatened species.
  Currently, the Yellow River community is being threatened by increased agricultural
  use and development. Due to these increasing threats, the staff of the Necedah National
  Wildlife Refuge began wildlife and vegetation surveys of this area in 1994.\",\n\t\"license_title\":
